    [],nt"num_tags": 0,nt"name": "benthic-sampling-adjacent-to-the-waianae-ocean-outfall-oahu-hawaii-2001-2010-nodc-accession-008d911b",nt"isopen":
    false,nt"url": null,nt"notes": "Annual surveys are undertaken to sample
    bottom-sediment for biological and geochemical analyses at six stations at a depth
    of approximately 34 m in the vicinity of the Waianae Wastewater Treatment Plant
    outfall diffuser on the leeward coast of Oahu, Hawaii. All stations had sediment
    fractions with >90% sand. Silt fractions were no more than 4% at any station. Oxidation-reduction-potential
    (ORP) and total-volatile-solids measurements of these sediments indicated a nonreducing
    benthic environment at all stations. This data set contains examination of the sediments
    for species, abundance, and richness of nonmollusks, crustacean, molluscan, nematode,
    oligochaete, and polychaete faunas. A PDF document provides annual summaries for
    2001-2010 while data files hold similar data for 2006-2009.",nt"owner_org":
